import Papa from 'papaparse';
import { useEffect, useState } from 'react';
import { Bar } from 'react-chartjs-2';
import { Chart as ChartJS, CategoryScale, LinearScale, BarElement, Title, Tooltip, Legend } from 'chart.js';

ChartJS.register(CategoryScale, LinearScale, BarElement, Title, Tooltip, Legend);

function Home() {
  const [chartData, setChartData] = useState({
    datasets: []
  });
  const [chartOptions, setChartOptions] = useState({});
  const [labelCountData, setLabelCountData] = useState([]);
  const [clickedLabelIndex, setClickedLabelIndex] = useState(null);
  const [showDoubleBarGraph, setShowDoubleBarGraph] = useState(true);

  useEffect(() => {
    Papa.parse('/static/data.csv', {
      download: true,
      header: true,
      dynamicTyping: true,
      delimiter: "",
      complete: (result) => {
        const labelCounts = {};

        result.data.forEach((item) => {
          const label = item['req1Product'];

          if (label) {
            if (labelCounts[label]) {
              labelCounts[label] += 1;
            } else {
              labelCounts[label] = 1;
            }
          }
        });

        setChartData({
          labels: Object.keys(labelCounts),
          datasets: [
            {
              label: "Count",
              data: Object.values(labelCounts),
              borderColor: "white",
              backgroundColor: "#defde0"
            }
          ]
        });

        setChartOptions({
          responsive: true,
          plugins: {
            legend: {
              position: 'top'
            },
            title: {
              display: true,
              text: "Count of req1Product Values",
              color: 'white'
            }
          },
          scales: {
            x: {
              ticks: {
                color: 'white'
              }
            },
            y: {
              beginAtZero: true,
              title: {
                display: true,
                text: "Count",
                color: 'white'
              },
              ticks: {
                color: 'white'
              }
            }
          }
        });
      }
    });
  }, []);

  const handleColumnClick = async (event, activeElements) => {
    if (activeElements.length > 0) {
      const labelIndex = activeElements[0].index;
      setClickedLabelIndex(labelIndex); // Update clicked label index

      const clickedLabel = chartData.labels[labelIndex];

      if (showDoubleBarGraph) {
        // Create a new chart for the label count from the 'prediction' column
        const predictionLabelCounts = {};
        await new Promise((resolve, reject) => {
          Papa.parse('/static/data.csv', {
            download: true,
            header: true,
            dynamicTyping: true,
            delimiter: "",
            complete: (result) => {
              result.data.forEach((item) => {
                const prediction = item['prediction'];
                const label = item['req1Product'];

                if (label === clickedLabel && prediction !== undefined) {
                  if (predictionLabelCounts[prediction]) {
                    predictionLabelCounts[prediction] += 1;
                  } else {
                    predictionLabelCounts[prediction] = 1;
                  }
                }
              });

              const labelCountChartData = {
                labels: Object.keys(predictionLabelCounts),
                datasets: [
                  {
                    label: "Count",
                    data: Object.values(predictionLabelCounts),
                    borderColor: "white",
                    backgroundColor: ["#ff4040", "#B6E4EB"]
                  }
                ]
              };

              const labelCountChartOptions = {
                responsive: true,
                plugins: {
                  legend: {
                    position: 'top'
                  },
                  title: {
                    display: true,
                    text: `Label Count for ${clickedLabel}`,
                    color: 'white'
                  }
                },
                scales: {
                  x: {
                    ticks: {
                      color: 'white'
                    }
                  },
                  y: {
                    beginAtZero: true,
                    title: {
                      display: true,
                      text: "Count",
                      color: 'white'
                    },
                    ticks: {
                      color: 'white'
                    }
                  }
                }
              };

              setLabelCountData((prevData) => {
                const newData = [...prevData];
                newData[labelIndex] = {
                  chartData: labelCountChartData,
                  chartOptions: labelCountChartOptions
                };
                return newData;
              });

              resolve();
            },
            error: (error) => {
              reject(error);
            }
          });
        });
      } else {
        // Create a new chart for the count of 0 and 1 occurrences in the 'prediction' column for each label
        const predictionLabelCounts = {};
        await new Promise((resolve, reject) => {
          Papa.parse('/static/data.csv', {
            download: true,
            header: true,
            dynamicTyping: true,
            delimiter: "",
            complete: (result) => {
              result.data.forEach((item) => {
                const prediction = item['prediction'];
                const label = item['req1Product'];

                if (prediction !== undefined) {
                  if (!predictionLabelCounts[label]) {
                    predictionLabelCounts[label] = {};
                  }

                  if (predictionLabelCounts[label][prediction]) {
                    predictionLabelCounts[label][prediction] += 1;
                  } else {
                    predictionLabelCounts[label][prediction] = 1;
                  }
                }
              });

              const labels = Object.keys(predictionLabelCounts);
              const datasets = labels.map((label) => ({
                label: label,
                data: Object.values(predictionLabelCounts[label]),
                backgroundColor: ["#ff4040", "#B6E4EB"]
              }));

              const labelCountChartData = {
                labels: ["a", "b", "c", "d"], // Assuming a, b, c, d are the prediction values
                datasets: datasets
              };

              const labelCountChartOptions = {
                responsive: true,
                plugins: {
                  legend: {
                    position: 'top'
                  },
                  title: {
                    display: true,
                    text: "Label Count for All Labels",
                    color: 'white'
                  }
                },
                scales: {
                  x: {
                    ticks: {
                      color: 'white'
                    }
                  },
                  y: {
                    beginAtZero: true,
                    title: {
                      display: true,
                      text: "Count",
                      color: 'white'
                    },
                    ticks: {
                      color: 'white'
                    }
                  }
                }
              };

              setLabelCountData([{
                chartData: labelCountChartData,
                chartOptions: labelCountChartOptions
              }]);

              resolve();
            },
            error: (error) => {
              reject(error);
            }
          });
        });
      }
    }
  };

  const handleCountButtonClick = () => {
    setShowDoubleBarGraph(!showDoubleBarGraph);
  };

  return (
    <div>
      <h4>Analysis</h4>
      <div className="import-boxes">
        {/* Import boxes code here */}
      </div>
      <div className="chart-container">
        <Bar data={chartData} options={chartOptions} getElementAtEvent={handleColumnClick} />
      </div>
      {clickedLabelIndex !== null && (
        <div className="label-count-container">
          <h5>{showDoubleBarGraph ? `Label Count for ${chartData.labels[clickedLabelIndex]}` : "Label Count for All Labels"}</h5>
          <Bar
            data={labelCountData[clickedLabelIndex].chartData}
            options={labelCountData[clickedLabelIndex].chartOptions}
          />
        </div>
      )}
      <div className="button-container">
        <button onClick={handleCountButtonClick}>{showDoubleBarGraph ? "Hide Double Bar" : "Show Double Bar"}</button>
      </div>
    </div>
  );
}

export default Home;
